import React from 'react';
import '../styles/About.css';
import { Helmet } from 'react-helmet';

class About extends React.Component {
  render() {
    return (
      <div className="about-container">
        <Helmet>
          <title>About Us | Techbitz.io - Delivering Digital Excellence</title>
          <meta name="description" content="Learn more about Techbitz.io, your partner for digital success. We provide unparalleled web solutions and digital marketing strategies tailored to your business." />
        </Helmet>
        <div className="heading">
          <h2>Who We Are</h2>
        </div>
        <div className="content">
          <p>At Techbitz.io, we are a team of dedicated digital professionals committed to delivering excellence. With years of experience in web development, digital marketing, testing services, and SEO, we take pride in tailoring our solutions to align with your business objectives. Our mission is to empower your online presence, optimize your website's performance, and help you engage your audience effectively.</p>
        </div>
      </div>
    );
  }
}

export default About;
